import React, { Component } from "react";
import { Link } from "react-router-dom";
import { AuthText, AuthTopBar } from "./constants.js";

class Landing extends Component {
	render() {
		return (
			<div className="valign-wrapper">
				<img
					alt=""
					className="container-background"
					src="images/background.jpg"
				/>
				<AuthTopBar />
				<div className="auth-left">
					<AuthText />

					<div className="row auth-button-row">
						<div className="col" style={{ paddingLeft: "0" }}>
							<Link
								to="/register"
								className=" waves-effect waves-light hoverable auth-button"
								style={{
									backgroundColor: "#ff367a",
									color: "#ffffff"
								}}
							>
								Register
							</Link>
						</div>
						<div className="col">
							<Link
								to="/login"
								className="waves-effect white black-text auth-button"
							>
								Log In
							</Link>
						</div>
					</div>
				</div>
			</div>
		);
	}
}
export default Landing;
